     <script lang="JavaScript">
        function toDataURL(url, callback) {
            var xhr = new XMLHttpRequest();

            xhr.onload = function() {
                
                    

                    var reader = new FileReader();
                    reader.onloadend = function() {
                        try {
                            mymessage =  window.openpgp.message.fromBinary(new Uint8Array(reader.result))

                            const options = {
                                message : mymessage,     
                                passwords : ['pw'],
                                armor : false
                            }
                            
                            window.openpgp.encrypt(options).then(ciphertext => {
                                encrypted = ciphertext.message 
                                
                                return encrypted
                            }).then(encrypted => {
                                const options = {
                                    message : encrypted,   
                                    passwords : ['pw'],
                                    format : 'binary'                               
                                }
                                window.openpgp.decrypt(options).then(plaintext => {
                                   
                                    try {
                                        //callback("data:image/jpeg;base64," + btoa(String.fromCharCode(plaintext.data)))
                                        var a = new FileReader();
                                        a.onload = function(e) {callback(e.target.result);}
                                        a.readAsDataURL(new Blob(plaintext.data));
                                    } catch (err) {
                                        alert(err)
                                    }
                                    
                                    return plaintext.data 
                                })
                            }, err => {
                                alert(err)
                            })      
                    } catch (err) {
                        alert(err)
                    }
                
                    
                    }
                    reader.readAsArrayBuffer(xhr.response);


                
            }

            xhr.open('GET', url);
            xhr.responseType = 'blob';
            xhr.send();
        }
